<!DOCTYPE html>

<body>
<script>
//alert('Hi User!! Please open your browser console');
var li = new LinkedList();
for(var i=10;i<30;i++){
	li.addItem(i);
}


//list traversal  data represents data at each node
var q = new Queue();
for(var j=10;j<30;j++)
	q.enqueue(j);

var st = new Stack();
for(var k=10;k<30;k++)
	st.push(k);

var setList = new Set();
for(var l=10;l<30;l++){
	setList.add(l);
}
</script>
